#define APPNAME "com.wrecktheline.linearsbox"


enum ExprType {
    kX = 0b000,
    kConst = 0b001,

    kVar = 0b010,

    kArthOp = 0b100,

    kCtx = 0b101,
};

enum ArthOpType {
    kAdd = 0b00,
    kSub = 0b01,
    kMul = 0b10,
};

std::tuple<half_float::half, bool> ParseAndEval(std::vector<uint8_t>::const_iterator & it, half_float::half x, std::vector<std::tuple<half_float::half, bool>> & env) {

    uint8_t v = *it++;


//    __android_log_print(ANDROID_LOG_VERBOSE, APPNAME, "parsing expr %d %d", v, *it);
    auto expr_type = static_cast<ExprType>(v >> 5);
    if (expr_type == ExprType::kX) {
        return std::make_tuple(x, true);
    } else if (expr_type == ExprType::kConst) {
        uint16_t val = (*it++);
        val += ((*it++) << 8);
        half_float::half hv{val};

//        __android_log_print(ANDROID_LOG_VERBOSE, APPNAME, "const %d %f", val, hv);
        return std::make_tuple(hv, false);
    } else if (expr_type == ExprType::kVar) {
        int idx = v & 0b11111;
        return env[idx];
    } else if (expr_type == ExprType::kArthOp) {
        auto arth_type = static_cast<ArthOpType>(*it++ & 0b11);
        auto [l_v, l_flag] = ParseAndEval(it, x, env);
        auto [r_v, r_flag] = ParseAndEval(it, x, env);
        if (arth_type == ArthOpType::kAdd) {
            return std::make_tuple(l_v + r_v, l_flag || r_flag);
        } else if (arth_type == ArthOpType::kSub) {
            return std::make_tuple(l_v - r_v, l_flag || r_flag);
        } else if (arth_type == ArthOpType::kMul) {
            if (l_flag && r_flag) {
                __android_log_print(ANDROID_LOG_VERBOSE, APPNAME, "error: expr not linear!");
                return std::make_tuple(half_float::half(std::numeric_limits<float>::infinity()), l_flag || r_flag);
            }
            return std::make_tuple(l_v * r_v, l_flag || r_flag);
        }
    } else if (expr_type == ExprType::kCtx) {
        int idx = v & 0b11111;
        auto old_val = env[idx];
        env[idx] = ParseAndEval(it, x, env);
        auto r = ParseAndEval(it, x, env);
        env[idx] = old_val;
        return r;
    }
}

